description:
Beyond the Mask (2015) PG  |  103 min  |  Action, Drama 

A British East India Trading Company assassin seeks to redeem his past by thwarting a plot against a young nation's hope for freedom.

On the run in the American Colonies, a mercenary (Andrew Cheney) must regain the trust of the woman (Kara Killmer) he loves, while racing against time to foil a diabolical plot.

Stars: Andrew Cheney, John Rhys-Davies, Kara Killmer


